/**
 * ResultsAdapter for inhouse-marketing assessment
 * Transforms raw scoring engine output into a consistent format for the results view
 */

class InhouseMarketingResultsAdapter {
  /**
   * Adapts raw scoring engine results to the format expected by ResultsView
   * @param {Object} rawResults - Raw output from the scoring engine
   * @param {Function} getResponse - Function to retrieve saved responses
   * @returns {Object} - Formatted results object
   */
  adaptResults(rawResults, getResponse) {
    if (!rawResults) {
      console.error('InhouseMarketingResultsAdapter: Received null/undefined rawResults');
      return null;
    }
    console.log('InhouseMarketingResultsAdapter: Processing raw results', Object.keys(rawResults || {}));

    // Extract key data points from raw results with fallbacks
    const overallScore = rawResults.overall || 0;
    const dimensionScores = rawResults.dimensions || {};
    const categoryScores = rawResults.categoryScores || {};
    const activityScores = rawResults.activityScores || {};
    const insights = rawResults.insights || [];
    const priorities = rawResults.priorities || [];
    const readinessLevel = rawResults.readinessLevel || {};
    const rawMarketPosition = rawResults.marketPosition || {};
    const savingsPotential = rawResults.savingsPotential || {};

    // Get metadata from responses if available
    const allResponses = {};
    try {
      // Get all saved question responses
      const questionTypes = ['qualifying', 'service_selection', 'dynamic_questions'];
      questionTypes.forEach(type => {
        const savedData = getResponse(type);
        if (savedData) {
          Object.assign(allResponses, savedData);
        }
      });
      console.log('InhouseMarketingResultsAdapter: Retrieved all responses', allResponses);
    } catch (error) {
      console.error('InhouseMarketingResultsAdapter: Error retrieving responses:', error);
    }

    // Extract company size and selected activities from responses or raw results
    const companySize = allResponses.company_size || rawResults.companySize || 'small';
    const selectedActivities = allResponses.selected_activities || rawResults.selectedActivities || [];
    const sector = allResponses.sector || rawResults.sector || 'other';

